


const int N=5+2;
const int MX=100000+5;

int prime[MX], np;
bool is_prime[MX];
inline void pre_prime() {
	is_prime[0]=is_prime[1]=false;
	for(int i=2; i<MX; ++i) is_prime[i]=true;
	for(int i=2; i<MX; ++i) {
		if(is_prime[i]) prime[++np]=i;
		for(int j=1, k; j<=np && (k=prime[j]*i)<MX; ++j) {
			is_prime[k]=false;
			if(i%prime[j]==0) break;
		}
	}
}

int pw[N];
inline void pre_pw() {
	pw[0]=1;
	for(int i=1; i<N; ++i) pw[i]=pw[i-1]*10;
}

int ans;
int sum[N];

int pi;
int n;

void dfs(int i, int j) {
	if(i>n) {
		++ans;
		return;
	}
	if(j>n) {
		if(is_prime[sum[i]]) dfs(i+1, i+1);
		return;
	}
	for(int x=0; x<=9; ++x) {
		sum[i]+=x*pw[n-j];
		if(i!=j) sum[j]+=x*pw[n-i];
		dfs(i, j+1); 
		sum[i]-=x*pw[n-j];
		if(i!=j) sum[j]-=x*pw[n-i];
	}
}

inline void pre() {
	pre_prime();
	pre_pw();
}
inline int work(int _pi) {
	pi=_pi;


	ans=0;
	sum[1]=pi;
	n=2;
	while(pi>=pw[n]) ++n;
	for(int i=2; i<=n; ++i) sum[i]=(pi/pw[n-i]%10)*pw[n-1];
	dfs(2, 2);
	return ans;
}

